import { Link } from "react-router-dom";

function ProductsPage() {
  return (
    <>
      <h1>제품 목록 페이지</h1>
      <ul>
        <li><Link to="/products/제품1번">제품 1번</Link></li>
        <li><Link to="/products/제품2번">제품 2번</Link></li>
        <li><Link to="/products/제품3번">제품 3번</Link></li>
      </ul>
    </>
  );
}

export default ProductsPage;
